import React from 'react';

function TrackOrder() {
  return (
    <div>
      <h2>Track Order</h2>
      <ul>
        <li>View Order Status</li>
        <li>Estimated Delivery Date</li>
      </ul>
    </div>
  );
}

export default TrackOrder;
